import React from 'react';
import { Route } from 'react-router-dom';
import InboxContainer from './InboxContainer/InboxContainer'


const Infobar = (props) => {
    return (
        <div>
            <Routes></Routes>
            <Route path='/im/*' element={
                <InboxContainer
                    store={props.store}
                />}
            />
        </div>
    )
}

export default Infobar;
